{'id': '6286470', 'org_name': 'ТИТАН, охранная фирма', 'text': 'Добрый день.
К сожалению для нас, но к счастью для клиентов - наши сотруднки работают 24/7/365, так что даже в новогодние праздники Вы можете быть спокойны за совю квартиру!

P.S. По статистике именно в новогодние праздники % ограблений сильно смещается с бизнеса в сторону частного сектора .', 'date_created': '2021-05-24T17:02:37.667704+07:00', 'logo_preview_urls': {}}

{'id': '5695255', 'org_name': 'ТИТАН, охранная фирма', 'text': 'Спасибо за Ваш отзыв! 

К сожалению именно охрана квартир является самой частой "профанацией" в сфере охраны со стороны недобросовестных конкурентов. Чаще всего ЧОП подключает квартиры за минимальную стоимость, но и отношение к данным объектам идет как ко "второму сорту".
В нашей организации подобного разделения нет, и реагирование на бизнес-объекты идёт с таким же приоритетом, как и на квартиры - поэтому и цена на охрану квартиры чуть выше.', 'date_created': '2021-03-23T21:34:50.023416+07:00', 'logo_preview_urls': {}}

{'id': '5644981', 'org_name': 'ТИТАН, охранная фирма', 'text': 'Добрый день!
Нам крайне жаль, что вы стали участником данного дорожного инцидента. Мы отслеживаем превышения скорости ГБР с помощью GPS датчиков, но, к сожалению, не все инциденты удаётся обнаружить.

Ни в коем случае не защищая манеру вождения ГБР, просим учесть, что возможно они ехали, чтобы спасти кому-то жизнь или пресечь ограблени.', 'date_created': '2021-03-17T22:08:57.121137+07:00', 'logo_preview_urls': {}}

{'id': '5514372', 'org_name': 'ТИТАН, охранная фирма', 'text': 'Добрый день.
Спасибо за отзыв. 

Как правило именно нажатие тревожной кнопки позволяет проверить ЧОП на РЕАЛЬНОЕ реагирование, т.к. собственных экипажей ГБР у многих мониторинговых компаний впринципе нет.', 'date_created': '2021-03-02T20:05:17.4744+07:00', 'logo_preview_urls': {}}
